measurements.description:
Phenomenal, exceptionally well-flowered, multi-crown specimen plant with 526 flowers and 130 buds on 65 inflorescences to 64cm long;
	plant 123cm tall, 195cm wide, 155cm deep in a 33cm tall, 90cm wide, 48cm deep slatted wooden basket;
	super-resupinate flowers typical of species; sepals and petals light green; lip white with 7.6cm spur;
	substance heavy; texture waxy.
